import { useLoaderData } from "react-router-dom";


export default function ListForTesting() {
  const loadedToDo = useLoaderData();

  return(
    <ul>
      {loadedToDo.map(p => <li key={p.task.slice(0,10)}>{p.task} ({p.deadline})</li>)}
    </ul>
  );
}
